import { createAsyncThunk } from "@reduxjs/toolkit";

export const postSignup = createAsyncThunk(
  "rootReducer/postSignup",
  ({ username, email, password }) => {
    const response = fetch("/signup", {
      method: "POST",
      body: {
        username,
        email,
        password,
      },
    });
    return response.json();
  }
);
